import React,{Component} from 'react'
import { Route } from 'react-router-dom'
import Weather from './weather'
import Search from './search'
import Location from './location'
import { tsConstructorType } from '@babel/types';

class App extends Component {

  constructor(){
    super()
    this.state={
      location:{city:'xinjiang',lngLat:[115,45]}
    }
  }
  render(){
    return (
      <div className="App">
           <Route exact path='/' render={()=><Weather></Weather>}></Route>
           <Route exact path='/search' render={()=><Search></Search>}></Route>
           <Route exact path='/location' render={()=><Location></Location>}></Route>
      </div>
    );
  }

}

export default App;
